import { useSearchParams } from 'react-router-dom';
import { useState } from 'react';
import './Menu.css';

function fetchKind() {
    fetch('http://127.0.0.1:5000/api/kind')
    .then(response => response.json())
    .then(data => {
        return data.kind;
    });
}

function Menu() {
    const [searchParams] = useSearchParams();
    const [kind, setKind] = useState();
    const whereToEat = searchParams.get('whereToEat');

    const menuKind = fetchKind();
    setKind(menuKind);

    console.log(menuKind);


    return (
        <>
            <header className='header'>{whereToEat}</header>
            <div className='menuKindSelector'>
                <button>{menuKind}</button>
            </div>
        </>
    );
}

export default Menu;
